import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Welcome to My Portfolio</h1>
      <p>I am an IT professional, and this is my portfolio built with React.</p>
    </div>
  );
}

export default App;
